import React from "react";

const produtos = [
  {
    id: 1,
    nome: "Smartphone",
    preco: "R$ 2000",
    cores: ["#29d8d5", "#252a34", "#fc3766"],
  },
  {
    id: 2,
    nome: "Notebook",
    preco: "R$ 3000",
    cores: ["#ffd045", "#d4394b", "#f37c59"],
  },
  {
    id: 3,
    nome: "Tablet",
    preco: "R$ 1500",
    cores: ["#365069", "#47c1c8", "#f95786"],
  },
];

const casa = [
    'casa 1', 'casa 2', 'casa 3'
]

const App2 = () => {
  return (
    <>
      <div>
        {casa.map((casa) => (
          <li>{casa}</li>
        ))}
      </div>
    </>
  );
};

export default App2;
